import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Bg from './images/Bg.jpg';

function Homepage() {
  return (
    <div className="text-white block font-serif font-extrabold bg-cover min-h-screen" style={{ backgroundImage: `url(${Bg})` }}>
      <div className="pt-5">
        <Header />
      </div>
      <div className="">
        <p className="text-6xl w-10 text-end pt-6">Welcome to my Blog Post Web</p>
        <h1 className="">Chhon</h1>
        <h1 className="">KimEang</h1>
        <p className="">OW Student</p>
      </div>
      <div className=" absolute pl-3 right-0 bottom-5">
        <Footer />
      </div>
    </div>
  );
}

export default Homepage;
